<!doctype html>
<html>
<head>
  <meta charset="utf-8">
  <title>Jasmine Spec Runner</title>

  
  <link rel="stylesheet" type="text/css" href=".grunt/grunt-contrib-jasmine/jasmine.css">
  

  <script src=".grunt/grunt-contrib-jasmine/require.js"></script>
  <script>
    require.onError = function(error) {
      var message = error.requireType + ': ';
      if (error.requireType === 'scripterror' || error.requireType === 'notloaded' && error.requireModules) {
        message += 'Illegal path or script error: ' + '[\'' + error.requireModules.join("', '") + '\']';
      } else {
        message += error.message;
      }

      throw Error(message);
    };
  </script>

  
  
  <script src=".grunt/grunt-contrib-jasmine/jasmine.js"></script>
  
  <script src=".grunt/grunt-contrib-jasmine/jasmine-html.js"></script>
  
  

  <script>
    

    
      require.config({
  "baseUrl": ".grunt/grunt-contrib-jasmine/src/",
  "paths": {
    "underscore": "../../../test/vendor/underscore-min"
  },
  "shim": {
    "underscore": {
      "exports": "_"
    }
  }
});
    
  </script>

  <script>
    function launchTest() {
    require([
      
        
        '_tree' 
      
    ],
    function(){
      require(['test/spec/Node.parseAndAddChild.spec.js','test/spec/Tree.clone.spec.js','test/spec/_node.addChildNode.spec.js','test/spec/_node.ids.spec.js','test/spec/_node.parent.spec.js','test/spec/_node.spec.js','test/spec/_tree.Node.extend.spec.js','test/spec/_tree.batch.spec.js','test/spec/_tree.contains.spec.js','test/spec/_tree.create.spec.js','test/spec/_tree.findByData.spec.js','test/spec/_tree.findNode.spec.js','test/spec/_tree.fromNode.spec.js','test/spec/_tree.inflate.spec.js','test/spec/_tree.mixin.spec.js','test/spec/_tree.moveNode.spec.js','test/spec/_tree.on_off.spec.js','test/spec/_tree.random.js','test/spec/_tree.removeAll.spec.js','test/spec/_tree.walk.spec.js','test/spec/immutability.spec.js','test/spec/modeling_example.spec.js','test/spec/serializeExamples.js','.grunt/grunt-contrib-jasmine/grunt-template-jasmine-istanbul/reporter.js','.grunt/grunt-contrib-jasmine/reporter.js'], function(){
        require(['.grunt/grunt-contrib-jasmine/jasmine-helper.js'], function(){
          // good to go! Our tests should already be running.
        })
      })
    }
    )
  }
  </script>

  
  <script>
  launchTest();
  </script>
  
</head>
